"   <div class=\"block pha drugH1Div\" id=\"F181419\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Reversibly inhibits cyclooxygenase-1 and 2 (COX-1 and 2) enzymes, which results in decreased formation of prostaglandin precursors; has antipyretic, analgesic, and anti-inflammatory properties",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     Other proposed mechanisms not fully elucidated (and possibly contributing to the anti-inflammatory effect to varying degrees), include inhibiting chemotaxis, altering lymphocyte activity,  inhibiting neutrophil aggregation/activation, and decreasing proinflammatory cytokine levels.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F181437\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Oral: Analgesic: 30-60 minutes; Anti-inflammatory: &le;7 days",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: Oral: 4-6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Oral: Rapid (85%)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 6.35 L; premature infants with ductal closure (highly variable between studies):",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Day 3: 145-349 mL/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Day 5: 72-222 mL/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 90% to 99%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via oxidation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Premature infants (highly variable between studies):",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Day 3: 35-51 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Day 5: 20-33 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Children 3 months to 10 years: 1.6 &plusmn; 0.7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adults: 2-4 hours; End-stage renal disease: Unchanged",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: Oral: ~1-2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (primarily as metabolites; 1% as unchanged drug); some feces",
"    </p>",
"   </div>",
